var Cryp=function(){function t(t,r){this.publicKey=t,this.privateKey=r,this.main=t.split(""),this.key=r.split("")}return t.prototype._encryptLetter=function(r){try{var t=this.main.findIndex(function(t){return t===r});return-1<t?this.key[t]:"-"}catch(t){return console.error(t),"-"}},t.prototype._decryptLetter=function(r){try{var t=this.key.findIndex(function(t){return t===r});return-1<t?this.main[t]:"-"}catch(t){return console.error(t),"-"}},t.prototype.encryptSentnece=function(t){var r=this;return t.split("").map(function(t){return r._encryptLetter(t)}).join("")},t.prototype.decryptSentnece=function(t){var r=this;return t.split("").map(function(t){return r._decryptLetter(t)}).join("")},t}();